pragma solidity ^0.8.7;

import "../Oracles/iii6VRFConsumer.sol";
import "./iii6Math.sol";

contract iiiDiaIdGen is iii6Math {
    iii6VRFEth private iii6VRFeth;
    iii6VRFGoerli private iii6VRFgoerli;
    iii6VRFFantom private iii6VRFfantom;
    iii6VRFFantomTest private iii6VRFfantomTest;
    iii6VRFMatic private iii6VRFmatic;
    iii6VRFMumbai private iii6VRFmumbai;
    iii6VRFBsc private iii6VRFbsc;
    iii6VRFChalen private iii6VRFchalen;
    iii6VRFAvax private iii6VRFavax;
    iii6VRFFuji private iii6VRFfuji;

    uint256 chid = block.chainid;
    uint256 public vrf_id;

    constructor() {
        vrf_id = _setVRFProjectID();
    }

    function _setVRFProjectID() internal returns (uint256 vrfBase) {
        // 
        // 
        // 
        // 
        // 
        // 
        if (chid == 1) {
            iii6VRFeth = iii6VRFEth(0x0000000000000000000000000000000000000000);
            vrfBase = iii6VRFeth.requestRandomWords();
        }
        // 
        // 
        // 
        // 
        // 
        // 
        else if (chid == 5) {
            iii6VRFgoerli = iii6VRFGoerli(
                0xd98489240409797BbA3Ad997037571e55555f4E0
            );
            vrfBase = iii6VRFgoerli.requestRandomWords();
        }
        // 
        // 
        // 
        // 
        // 
        // 
        else if (chid == 137) {
            iii6VRFmatic = iii6VRFMatic(
                0x8719F9E85aA0627ac9c34926D06C92b677Bd4ca9
            );
            vrfBase = iii6VRFmatic.requestRandomWords();
        }
        //  
        //  
        //  
        //  
        //  
        //  
        else if (chid == 80001) {
            iii6VRFmumbai = iii6VRFMumbai(
                0x12c91b97BC2A6d9bFCcd7a7f45d841741490A100
            );
            vrfBase = iii6VRFmumbai.requestRandomWords();
        }
        // 
        // 
        // 
        // 
        // 
        // 
        else if (chid == 56) {
            iii6VRFbsc = iii6VRFBsc(0x0000000000000000000000000000000000000000);
            vrfBase = iii6VRFbsc.requestRandomWords();
        }
        // 
        // 
        // 
        // 
        // 
        // 
        else if (chid == 97) {
            iii6VRFchalen = iii6VRFChalen(
                0x0000000000000000000000000000000000000000
            );
            vrfBase = iii6VRFchalen.requestRandomWords();
        }
        // 
        // 
        // 
        // 
        // 
        // 
        else if (chid == 43114) {
            iii6VRFavax = iii6VRFAvax(
                0x0000000000000000000000000000000000000000
            );
            vrfBase = iii6VRFavax.requestRandomWords();
        }
        // 
        // 
        // 
        // 
        // 
        // 
        else if (chid == 43113) {
            iii6VRFfuji = iii6VRFFuji(
                0x79a5E2bBc6e1EaC0764Bf6F980b4Ec6494A6d8a0
            );
            vrfBase = iii6VRFfuji.requestRandomWords();
        }
        // 
        // 
        // 
        // 
        // 
        // 
        else if (chid == 250) {
            iii6VRFfantom = iii6VRFFantom(
                0x0000000000000000000000000000000000000000
            );
            vrfBase = iii6VRFfantom.requestRandomWords();
        }
        // 
        // 
        // 
        // 
        // 
        // 
        else if (chid == 4002) {
            iii6VRFfantomTest = iii6VRFFantomTest(
                0xaF4C0EE5f1aDF34bCE6b4E2B6D164cA6C6154c74
            );
            vrfBase = iii6VRFfantomTest.requestRandomWords();
        }
    }

    function getProjectId() external view returns (uint256 vrf) {
        vrf = vrf_id;
    }

    function _makeProjectKeypair() external {}
}
